import './Navbar.css';
import { Link } from 'react-router-dom';

function Navbar() {
  return(
    <div className="navbar">
        <div className="btn">
            <ul>
                <Link to="/">
                    <img className="logo" src="webshio.png" alt=""/>
                </Link>
                <Link to="add-item">
                    <button>Lisa uus ese</button>
                </Link>
            </ul>

        </div>
        <Link to="cart">
            <img className="cart" src="cart.svg" alt=""/>
        </Link>
    </div>

  );
}

// alumine tehke ise

export default Navbar;
